# OEIS sequence: A348320

def ispal(n): s = str(n); return s == s[::-1]
def aupto(limit):
    aset, m, mm = set(), 2, 4
    while mm <= limit:
        if ispal(m):
            mk = mm
            while mk <= limit:
                if not ispal(mk): aset.add(mk)
                mk *= m
        mm += 2*m + 1
        m += 1
    return sorted(aset)
print(aupto(47000)) # _Michael S. Branicky_, Oct 12 2021

